import CircularProgress from 'material-ui/CircularProgress';
import {GridList, GridTile} from 'material-ui/GridList';
import IconButton from 'material-ui/IconButton';
import Paper from 'material-ui/Paper';
import RaisedButton from 'material-ui/RaisedButton';
import React, {Component} from 'react';
import {connect} from 'react-redux';
import {NavLink} from 'react-router-dom';

import {coursesActions} from '../../actions';

import EditIcon from 'material-ui/svg-icons/editor/mode-edit';
import {namingConstants} from '../../constants';

class CourseImage extends Component {
    constructor(props) {
        super(props);
        this.state = {loaded: false};
        
        this.course = props.course;
    }

    render() {
        return (
            <div>
                {this.state.loaded ? null :
                    <img style={{width: "100%"}}
                        
                        
                         src={"data:image/png;base64,"}
                         alt={this.course.section_name}/>

                }
                <img
                    style={{width: "100%"}}
                    src={this.course.media.image.large}
                    alt={this.course.name}
                    onLoad={() => {
                        this.setState({loaded: true})
                    }
                    }
                />
            </div>
        );
    }
}

class CourseList extends Component {

    componentWillMount() {
        const {dispatch} = this.props;
        
        dispatch(coursesActions.getCourses());
    }

    render() {
        const {fetching, courses} = this.props;

        
        
        
        
        
        
        
        

        const courseImage = (course) => {

            return (
                <CourseImage course={course}/>
            )
        }
        return (
            <div style={{display: "flex", justifyContent: "center", paddingBottom: "100px"}}>
                <br/>
                <Paper className={"edtx-paper"}  style={{paddingLeft: "5%", paddingBottom: "75px", zDepth: 2}}>
                    <h2 style={{
                        width: "100%",
                        fontSize: "2em",
                        padding: "0 0.3em 0.3em 0.3em"
                    }}>{namingConstants.COURSE_PLURAL}</h2>
                    {fetching ?
                        <div>
                            <CircularProgress size={60} thickness={7}/>
                        </div> :
                        <div style={{
                            display: "flex",
                            flexWrap: 'wrap',
                            justifyContent: 'space-around',
                            width: "100%"
                        }}>
                            <NavLink style={{
                                width: "100%",
                                marginRight: 3,
                                marginBottom: 32,
                                display: "flex",
                                justifyContent: "flex-start"
                            }} to="/new_course">
                                <RaisedButton label={"Create new " + namingConstants.COURSE} backgroundColor={'#364D7C'}
                                              labelColor='#fff'/>
                            </NavLink>
                            <GridList
                                cellHeight={180}
                                className="sheetList"
                                cols={1}

                            >
                                {courses.map((course) => (
                                    <NavLink to={"/courses/" + course.course_id}
                                             key={course.course_id}>
                                        <GridTile
                                            key={course.course_id}
                                            title={course.name}
                                            subtitle={
                                                <span><b>{course.start_display}</b></span>}
                                            actionIcon={
                                                <IconButton><EditIcon color="white" onClick={(e) => {
                                                    e.preventDefault();
                                                    e.stopPropagation();
                                                    this.props.history.push('/edit_course/' + course.course_id)
                                                }
                                                }/></IconButton>
                                            }
                                        >
                                            {courseImage(course)}
                                        </GridTile>
                                    </NavLink>
                                ))}
                            </GridList>
                        </div>
                    }
                </Paper>
            </div>
        )
    }
}

function mapStateToProps(state) {
    const {fetching, courses} = state.courses;
    return {
        fetching,
        courses
    };
}

const connectedCourseList = connect(mapStateToProps)(CourseList);
export {connectedCourseList as CourseList};
